import {withRouter} from 'next/router'//接收query数据
import Link from 'next/link'

const Game = ({router})=>{
    return(
        <div>
            <div>
                Hannibal play {router.query.name}
            </div>
            <div><Link href='/'><a>返回首页</a></Link></div>
        </div>
    )
}

export default withRouter(Game)
